import {Link,useParams } from "react-router-dom";

function Navbar({user}){
    return (
    <div>
        <Link to="/">Home</Link>
        {
            user?
            <>
                <Link to="/user">User</Link>
                <Link to="/projects">Projects</Link>
            </>
            :
            <Link to="/login">Login</Link>
        }
    </div>
    )
}
export default Navbar
